import React, { Component } from 'react';
import Vimeo from '@u-wave/react-vimeo';
import ReactPlayer from "react-player"

import './video.css';


class Videos extends Component {
    constructor() {
        super();

    }

    PlayVideo(id) {
        var video = document.getElementById(id).children[0]
        console.log(video)
        video.setAttribute('playing', 'true')
    }


    render() {
        return (
            <div className="videobox">
                {this.state.videos.map((data, i) => {
                    return (
                        <div className="video" key={i} >
                            <ReactPlayer
                                url={data.src}
                                controls="true"
                                width="100%"
                                height="100%"
                                loop="true"
                                id={data.id}
                            />
                        </div>
                    )
                })}
                <ReactPlayer
                    url={'https://vimeo.com/45088660'}
                    controls="true"
                    width="100%"
                    height="100%"
                    loop="true"
                />
            </div>
        );
    }
}

export default Videos
